                            label={label}
                            required
                        />
                    )}
                    as={TextField}
                    control={control}
                    fullWidth
                    name={name}
                    label={label}
                />
            </Grid>
        );
        */

    return (
        <Grid item xs={12} sm={6}>
            <Controller
                control={control}
                name={name}
                render={({ field }) => (
                    <TextField
                        fullWidth
                        label={label}
                        required
                    />
                )}
            />
        </Grid>
    )
}

export default FormInput;
